
const STAT_W_o={read__v:(e,s,_="text")=>{fetch(e).then((e=>{if(e.ok)return e[_]();throw new Error(`${e.status}: ${e.statusText}`)})).then((e=>{s(e)})).catch((e=>console.error(e)))},get_scan__v:e=>{STAT_W_o.read__v(`/assets/media/img/${e}/full/max/0/scan.json`,(e=>{self.postMessage({task_s:"PUT_scan",scan_a:e},[new ArrayBuffer(e)])}))},receive__v:e=>{const s=e.data;switch(s.task_s){case"GET_scan":STAT_W_o.get_scan__v(s.work_s)}}};self.addEventListener("message",STAT_W_o.receive__v,!0);